description:{"ja":"人質となった王女は、キッチンを望む！

小国・ピアリーの第二王女・センテイには、前世の記憶がある。日本で生まれ、順調に年を重ねて、病院で穏やかに終えた人生の記憶が。今度も穏やかに過ごせるのかな・・・なんて思った矢先大国・アンテからの要請で、人質となるため留学することに。

歳の離れた素敵な人たちに優しく見守られて灰色っぽい人質生活を、虹色のスローライフに変えるため転生王女のキッチン生活、始めます♪"}

